ParseSmileys();


(function() {
var css = "@namespace url(http://www.w3.org/1999/xhtml); div.block-a img.HeaderTheUndergroundForumId {background-image: url(data:image/jpeg;base64,) !important ; background-repeat: no-repeat !important ;margin: 0 !important ; padding: 0 !important ; }";
if (typeof GM_addStyle != "undefined") {
GM_addStyle(css);
} else if (typeof addStyle != "undefined") {
addStyle(css);
} else {
var heads = document.getElementsByTagName("head");
if (heads.length > 0) {
var node = document.createElement("style");
node.type = "text/css";
node.appendChild(document.createTextNode(css));
heads[0].appendChild(node);
}
}
})();